#nullable enable
namespace Froggies.Resources;
public static class SvgPngImageResource
{
    private readonly static string _frog = "data:image/png;base64,";
    public static string Frog => "frog.png";
    private readonly static string _leaf = "data:image/png;base64,";
    public static string Leaf => "leaf.png";
    public static void Register()
    {
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("frog.png", _frog);
        CommonBasicLibraries.AdvancedGeneralFunctionsAndProcesses.FileFunctions.FileContentRegistry.RegisterFile("leaf.png", _leaf);
    }
}